const RECEIVE_LOCATIONS = 'locationStore/locations/RECEIVE_LOCATIONS';

const initialState = {
  locations: {
    europe: {
      finland: {
        oulu: null,
        helsinki: null,
        tornio: null,
        kemili: null,
      },
      sweden: {
        lulea: null,
        uppsala: null,
        goteborg: null,
        stockholm: null,
      },
      norway: {
        oslo: null,
        tromso: null,
        vardo: null,
        bergen: null,
      },
      denmark: {
        copenhagen: null,
        helsingor: null,
        skagen: null,
        alborg: null,
      },
    },
  },
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case RECEIVE_LOCATIONS: {
      const { locations } = action;
      console.log()
      return { locations };
    }
    default:
      return state;
  }
};

export default reducer;
